var COURIER={autoRun:[]};COURIER.slugify=function(a){return a.toString().toLowerCase().replace(/\s+/g,"-").replace(/[^\w\-]+/g,"").replace(/\-\-+/g,"-").replace(/^-+/,"").replace(/-+$/,"")},COURIER.autoRun.push("nameSlugPopulation"),COURIER.nameSlugPopulation=function(){$(".js-name-slug").each(function(){var a=$(this);a.on("keyup",function(){$("."+a.data("slug-target")).val(COURIER.slugify(a.val()))})})},COURIER.autoRun.forEach(function(a){COURIER[a]()});